<p>其中大部分的使用看<a href="https://kazupon.github.io/vue-i18n/zh/started.html#javascript" title="vue-i18n" target="_blank" rel="noopener noreferrer">官网</a>就够了,这里仅记录一些在实际使用中的问题。</p>
